import React from 'react'

import { Formik } from 'formik'

const LivingPlaceRegistrationSomeQuestionsFormik = () => {

    return (
        <>
            <Formik
                initialValues={{
                    email: '',
                    password: ''
                }}
                onSubmit={( data ) => console.log(data)}
            >
                {({
                    handleSubmit
                }) => {
                    return (
                        <form onSubmit={handleSubmit}></form>
                    )
                }}
            </Formik>
        </>
    )
}

export default LivingPlaceRegistrationSomeQuestionsFormik
